(window.webpackJsonp=window.webpackJsonp||[]).push([[114],{2121:function(e,t,n){"use strict";n.r(t);var a=n(54),r=n(55),o=n(57),i=n(56),s=n(58),l=n(0),u=n.n(l),c=n(2087),h=n(2095),d=n(68),p=n(70),w=n(67),m=n(242),f=function(e){function t(){return Object(a.a)(this,t),Object(o.a)(this,Object(i.a)(t).apply(this,arguments))}return Object(s.a)(t,e),Object(r.a)(t,[{key:"render",value:function(){return u.a.createElement(c.a,null,u.a.createElement(h.a,{sm:12},u.a.createElement(d.a,null,u.a.createElement(p.a,null,u.a.createElement("h5",null,"Classic Editor")),u.a.createElement(w.a,null,u.a.createElement(m.a,{html:'<h3>Walking the capitals of Europe: Warsaw</h3>\n    <figure class="image"><img alt="Picture of the Warsaw Old Town." src="https://ckeditor.com/assets/images/bg/umbrellas-e935d5c582.jpg">\n        <figcaption>Medieval Old Town square, destroyed in 1944 & rebuilt after WWII.</figcaption>\n    </figure>\n    <p>If you enjoyed my previous articles in which we discussed wandering around <a href="#!" target="_blank" rel="noopener">Copenhagen</a> and <a href="#!" target="_blank" rel="noopener">Vilnius</a>, you\u2019ll definitely love exploring <a href="https://en.wikipedia.org/wiki/Warsaw" target="_blank" rel="noopener">Warsaw</a>.</p>\n    <h3>Time to put comfy sandals on!</h3>\n    <p>Best time to visit the city is July and August, when it\u2019s cool enough to not break a sweat and hot enough to enjoy summer. The city which has quite a combination of both old and modern textures is located by the river of Vistula.</p>\n    <p>The historic <strong>Old Town</strong>, which was reconstructed after the World War II, with its late 18th century characteristics, is a must-see. You can start your walk from the <strong>Nowy \u015awiat Street</strong> which will take you straight to the Old Town.</p>\n    <p>Then you can go to the <strong>Powi\u015ble</strong> area and take a walk on the newly renovated promenade on the riverfront. There are also lots of cafes, bars and restaurants where you can shake off the exhaustion of the day. On Sundays, there are many parks where you can enjoy nature or listen to pianists from around the world playing Chopin.</p>\n    <p>For museum lovers, you can add these to your list:</p>\n    <ul>\n        <li>POLIN</li>\n        <li>Warsaw Uprising Museum</li>\n        <li>Fryderyk Chopin Museum</li>\n    </ul>\n    <h3>Next destination</h3>\n    <p>We will go to Berlin and have a night\'s walk in the city that never sleeps! Make sure you subscribe to our newsletter!</p>',editor:"classic"})))))}}]),t}(l.Component);t.default=f},242:function(e,t,n){"use strict";var a=n(54),r=n(55),o=n(57),i=n(56),s=n(58),l=n(0),u=n.n(l),c=n(421),h=n.n(c),d=n(422),p=n.n(d),w=n(432),m=n.n(w),f=n(433),y=n.n(f),g=n(434),b=n.n(g);function k(e){switch(e){case"classic":return p.a;case"balloon":return y.a;case"inline":return m.a;case"document":return b.a;default:return p.a}}var v=function(e){function t(){return Object(a.a)(this,t),Object(o.a)(this,Object(i.a)(t).apply(this,arguments))}return Object(s.a)(t,e),Object(r.a)(t,[{key:"render",value:function(){var e=this;return u.a.createElement(h.a,{editor:k(this.props.editor),data:this.props.html,onInit:function(t){"document"===e.props.editor&&(document.querySelector(".document-editor__toolbar").appendChild(t.ui.view.toolbar.element),window.editor=t)},onChange:function(e,t){},onBlur:function(e){},onFocus:function(e){}})}}]),t}(u.a.Component);t.a=v}}]);
